import "./App.css";
import Sidebar from "./components/Sidebar";
import SupervisorProfiles from "./components/SupervisorProfiles";
import Dashboard from "./components/Dashboard";
import UserProfile from "./components/UserProfile";
import { BrowserRouter, Route, Routes, Link } from "react-router-dom";


// function App() {

//   return (
//     <div className="App">
//         <Sidebar/>
//         <SupervisorProfiles/>
//     </div>
//   );
// }

function App() {
  return (
    <BrowserRouter>
      <div className="App">
          {/*          
          <Link to="/">Dashboard</Link>
           <Link to="/supervisor-profiles">Supervisor Profiles</Link>
           <Link to="/your-profile">Your Profiles</Link>
          */}
        <Routes>
          <Route path="/" element={<Dashboard/>} />
          <Route path="/supervisor-profiles" element={<SupervisorProfiles/>} />
          <Route path="/your-profile" component={UserProfile} />
        </Routes>
      </div>
    </BrowserRouter>
  );
 }

export default App;
